		[TestMethod]
		public async Task GetAsteroidsAsync_RequestFails()
		{
			// Arrange
			var fakeResponse = new HttpResponseMessage(HttpStatusCode.InternalServerError); // Simula un error del servidor

			_mockHttpMessageHandler.Protected()
				.Setup<Task<HttpResponseMessage>>(
					"SendAsync",
					ItExpr.IsAny<HttpRequestMessage>(),
					ItExpr.IsAny<CancellationToken>()
				)
				.ReturnsAsync(fakeResponse);

			// Act & Assert
			await Assert.ThrowsExceptionAsync<HttpRequestException>(() => _nasaService.GetAsteroidsAsync(5));
		}

		[TestMethod]
		public async Task Get_EndpointCalledWithInvalidDaysParameter_ReturnsBadRequest()
		{
			// Arrange
			var nasaServiceMock = new Mock<INasaService>();
			var controller = new AsteroidsController(nasaServiceMock.Object);

			// Act
			var resultUnderOne = await controller.Get(0); // Menor a 1
			var resultOverSeven = await controller.Get(8); // Mayor a 7

			// Assert
			Assert.IsInstanceOfType(resultUnderOne, typeof(BadRequestObjectResult));
			Assert.IsInstanceOfType(resultOverSeven, typeof(BadRequestObjectResult));
		}

		[TestMethod]
		public async Task GetAsteroidsAsync_EmptyResponse()
		{
			// Arrange
			var fakeResponse = new HttpResponseMessage(HttpStatusCode.OK)
			{
				Content = new StringContent("") // Respuesta vacía
			};

			_mockHttpMessageHandler.Protected()
				.Setup<Task<HttpResponseMessage>>(
					"SendAsync",
					ItExpr.IsAny<HttpRequestMessage>(),
					ItExpr.IsAny<CancellationToken>()
				)
				.ReturnsAsync(fakeResponse);

			// Act
			var result = await _nasaService.GetAsteroidsAsync(5);

			// Assert
			Assert.AreEqual(0, result.Count()); // Asumiendo que el método ParseAsteroidResponse devuelve una lista vacía si el JSON está vacío
		}

